CREATE TABLE IF NOT EXISTS `PREFIX_btmegamenu` ( `id_btmegamenu` int(11) NOT NULL AUTO_INCREMENT, `image` varchar(255) NOT NULL, `id_parent` int(11) NOT NULL, `is_group` tinyint(1) NOT NULL, `width` varchar(255) DEFAULT NULL, `submenu_width` varchar(255) DEFAULT NULL, `submenu_colum_width` varchar(255) DEFAULT NULL, `item` varchar(255) DEFAULT NULL, `colums` varchar(255) DEFAULT NULL, `type` varchar(255) NOT NULL, `is_content` tinyint(1) NOT NULL, `show_title` tinyint(1) NOT NULL, `type_submenu` varchar(10) NOT NULL, `level_depth` smallint(6) NOT NULL, `active` tinyint(1) NOT NULL, `position` int(11) NOT NULL, `submenu_content` text NOT NULL, `show_sub` tinyint(1) NOT NULL, `target` varchar(25) DEFAULT NULL, `privacy` smallint(6) DEFAULT NULL, `position_type` varchar(25) DEFAULT NULL, `menu_class` varchar(25) DEFAULT NULL, `content` text, `icon_class` varchar(255) DEFAULT NULL, `level` int(11) NOT NULL, `left` int(11) NOT NULL, `right` int(11) NOT NULL, `submenu_catids` text, `is_cattree` tinyint(1) DEFAULT '1', `date_add` datetime DEFAULT NULL, `date_upd` datetime DEFAULT NULL, PRIMARY KEY (`id_btmegamenu`) ) ENGINE=ENGINE_TYPE AUTO_INCREMENT=107 DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `PREFIX_btmegamenu_lang` ( `id_btmegamenu` int(11) NOT NULL, `id_lang` int(11) NOT NULL, `title` varchar(255) DEFAULT NULL, `text` varchar(255) DEFAULT NULL, `url` varchar(255) DEFAULT NULL, `description` text, `content_text` text, `submenu_content_text` text, PRIMARY KEY (`id_btmegamenu`,`id_lang`) ) ENGINE=ENGINE_TYPE DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `PREFIX_btmegamenu_shop` ( `id_btmegamenu` int(11) NOT NULL DEFAULT '0', `id_shop` int(11) NOT NULL DEFAULT '0', PRIMARY KEY (`id_btmegamenu`,`id_shop`) ) ENGINE=ENGINE_TYPE DEFAULT CHARSET=utf8;
